(2, 'Theme One', 'theme_one', 'themeone', '{\"home_page_title\":{\"value\":\"Menorah OES\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Home Page Title\"},\"home_page_link\":{\"value\":\"\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Home Page Link\"},\"home_page_image\":{\"value\":\"i2xmCGQqDhiXweA.png\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"Background image at front end before login\"},\"home_page_background_image\":{\"value\":\"f2VIEaFCIuqAaoM.png\",\"type\":\"file\",\"extra\":\"\",\"tool_tip\":\"Background image at front end before login\"},\"home_page_facebook_link\":{\"value\":\"https:\\/\\/www.facebook.com\\/\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Home Page Title\"},\"home_page_twitter_link\":{\"value\":\"https:\\/\\/twitter.com\\/login?lang=en\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Home Page Title\"},\"home_page_googleplus_link\":{\"value\":\"https:\\/\\/plus.google.com\\/discover\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Home Page Title\"},\"copyrights\":{\"value\":\" Copyright \\u00a9 2009 - 2018  Test Software Technologies Pvt. Ltd. All Rights Reserved\",\"type\":\"text\",\"extra\":\"\",\"tool_tip\":\"Copy Rights Information\"},\"courses\":{\"value\":\"<p>Aerospace Engineering<\\/p>\\r\\n\\r\\n<p>Computer Science Engineering<\\/p>\\r\\n\\r\\n<p>Mechanical Engineering<\\/p>\\r\\n\\r\\n<p>Electrical Engineering<\\/p>\\r\\n\\r\\n<p>Civil Engineering<\\/p>\\r\\n\\r\\n<p>Finance<\\/p>\\r\\n\\r\\n<p>Human Resource Management<\\/p>\\r\\n\\r\\n<p>Sales and Marketing<\\/p>\\r\\n\\r\\n<p>Operations Management<\\/p>\\r\\n\\r\\n<p>\\u00a0<\\/p>\\r\\n\",\"type\":\"textarea\",\"extra\":\"\",\"tool_tip\":\"Courses\"},\"pattren\":{\"value\":\"<p>Unlike CBSE\'s old pattern of only one test at the end of the academic year, the CCE conducts several. There are two different types of tests. Namely, the <em>formative<\\/em> and the <em>summative<\\/em>. Formative tests will comprise the student\'s work at class and home, the student\'s performance in oral tests and quizzes and the quality of the projects or assignments submitted by the child. Formative tests will be conducted four times in an academic session, and they will carry a 40% weightage for the aggregate. In some schools, an additional written test is conducted instead of multiple oral tests. However, at least one oral test is conducted.<\\/p>\\r\\n\\r\\n<p>The summative assessment is a three-hour long written test conducted twice a year. The first summative or <em>Summative Assessment 1<\\/em> (SA-1) will be conducted after the first two formatives are completed. The second (SA-2) will be conducted after the next two formatives. Each summative will carry a 30% weightage and both together will carry a 60% weightage for the aggregate. The summative assessment will be conducted by the schools itself. However, the question papers will be partially prepared by the CBSE and evaluation of the answer sheets is also strictly monitored by the CBSE. Once completed, the syllabus of one summative <em>will not<\\/em> be repeated in the next. A student will have to concentrate on totally new topics for the next summative<\\/p>\\r\\n\",\"type\":\"textarea\",\"extra\":\"\",\"tool_tip\":\"pattren\"},\"pricing\":{\"value\":\"\",\"type\":\"textarea\",\"extra\":\"\",\"tool_tip\":\"pricing\"},\"syllabus\":{\"value\":\"<p>The syllabus for each of the papers can be found by clicking on the papers (subject) below. Refer table 4.2 in the Information Brochure to know what sections appear in each paper, especially in XE and XL.<\\/p>\\r\\n\\r\\n<p>\\u00a0<\\/p>\\r\\n\\r\\n<table align=\\\"center\\\" border=\\\"1\\\" cellpadding=\\\"10\\\" cellspacing=\\\"0\\\" style=\\\"width:60%\\\">\\r\\n\\t<tbody>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<td colspan=\\\"2\\\"><a href=\\\"http:\\/\\/www.gate.iitg.ac.in\\/Syllabi\\/General-Aptitude.pdf\\\" target=\\\"_blank\\\">General Aptitude (GA) : Common in all papers<\\/a><\\/td>\\r\\n\\t\\t<\\/tr>\\r\\n\\t\\t<tr>\\r\\n\\t\\t\\t<t